import React, { useState } from 'react';

const API_BASE_URL = 'http://127.0.0.1:5000';

// This component now takes an `onLogin` prop from AppWrapper
function AppWrapper({ onLogin }) { 
  const [isSignup, setIsSignup] = useState(false);
  const [formData, setFormData] = useState({
    username: "",
    email: "",
    phone: "",
    password: "",
    confirmPassword: ""
  });
  const [error, setError] = useState("");
  const [message, setMessage] = useState("");
  const [isLoading, setIsLoading] = useState(false);

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError("");
    setMessage("");
    setIsLoading(true);

    let endpoint;
    let payload;

    if (isSignup) {
      // --- SIGNUP LOGIC ---
      if (formData.password !== formData.confirmPassword) {
        setError("Passwords do not match!");
        setIsLoading(false);
        return;
      }
      endpoint = `${API_BASE_URL}/signup`;
      payload = {
        username: formData.username,
        email: formData.email,
        phone: formData.phone,
        password: formData.password
      };
    } else {
      // --- LOGIN LOGIC ---
      endpoint = `${API_BASE_URL}/login`;
      payload = {
        // Your backend expects 'loginId', which can be an email or a phone number.
        // We will use the 'email' field from the form for this.
        loginId: formData.email, 
        password: formData.password
      };
    }

    try {
      const response = await fetch(endpoint, {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(payload)
      });

      const data = await response.json();

      if (data.success) {
        if (isSignup) {
          setMessage("🎉 Account created successfully! You can now log in.");
          setIsSignup(false); // Switch to login view
        } else {
          // On successful login, pass the full user object back to AppWrapper
          onLogin(data.user);
        }
      } else {
        setError(data.message || 'An unexpected error occurred.');
      }
    } catch (err) {
      setError("⚠️ Server error. Please try again.");
      console.error("Auth error:", err);
    } finally {
      setIsLoading(false);
    }
  };
  
  const switchMode = () => {
    setIsSignup(!isSignup);
    setError("");
    setMessage("");
    // Clear form when switching
    setFormData({ username: "", email: "", phone: "", password: "", confirmPassword: "" });
  };

  return (
    <div className="auth-container">
      <div className="auth-box">
        <h1>🌙 MoodMate</h1>
        <p>Your mental health companion</p>
        
        {error && <div className="error-message">{error}</div>}
        {message && <div className="success-message">{message}</div>}

        <form onSubmit={handleSubmit} className="auth-form">
          {isSignup && (
            <>
              <input type="text" name="username" placeholder="Username" value={formData.username} onChange={handleChange} required disabled={isLoading} />
              <input type="email" name="email" placeholder="Email" value={formData.email} onChange={handleChange} required disabled={isLoading} />
              <input type="tel" name="phone" placeholder="Phone Number" value={formData.phone} onChange={handleChange} required disabled={isLoading} />
            </>
          )}

          {!isSignup && (
            <input type="text" name="email" placeholder="Email or Phone Number" value={formData.email} onChange={handleChange} required disabled={isLoading} />
          )}

          <input type="password" name="password" placeholder="Password" value={formData.password} onChange={handleChange} required disabled={isLoading} />

          {isSignup && (
            <input type="password" name="confirmPassword" placeholder="Confirm Password" value={formData.confirmPassword} onChange={handleChange} required disabled={isLoading} />
          )}

          <button type="submit" disabled={isLoading}>{isLoading ? 'Processing...' : (isSignup ? "Sign Up" : "Login")}</button>
        </form>

        <p className="toggle-text">
          {isSignup ? "Already have an account? " : "New here? "}
          <span onClick={switchMode} className="toggle-link">
            {isSignup ? "Login" : "Sign Up"}
          </span>
        </p>
      </div>
    </div>
  );
}

export default AppWrapper;
